import { useState } from 'react';

function App() {

  const firstNumber = 5;
  //const [firstNumber, setFirstNumber] = useState(0);
  const [secondNumber, setSecondNumber] = useState(0);
  const [result, setResult] = useState(0);

  function handleClick(type, firstNumber, secondNumber) {
    const body = "type" + "=" + type + "&" 
    + "firstNumber" + "=" + firstNumber + "&"
    + "secondNumber" + "=" + secondNumber;

    fetch("http://localhost:5000/", {
      method: "POST",
      headers: {
        "Content-Type": "application/x-www-form-urlencoded",
      },
      body: body
    }).then((res) => {
      return res.json();
    }).then((data) => {
      setResult(data);
    });


  }

  function AddButton({ onClick }) {
    return (
      <button onClick={onClick("add", firstNumber, secondNumber)}>Add</button>
    );
  }

  function SubtractButton({ onClick }) {
    return (
      <button onClick={onClick("subtract", firstNumber, secondNumber)}>Subtract</button>
    );
  }  

  return (
    <div>
        <input name="firstNumber" text={firstNumber} />
        <input name="secondNumber" text={secondNumber} />
        <AddButton onClick={handleClick} />
        <SubtractButton onClick={handleClick} />
        {firstNumber}
    </div>
  );


}

export default App;
